func (this *Account) Compare(that interface{}) int {
	if that == nil {
		if this == nil {
			return 0
		}
		return 1
	}

	that1, ok := that.(*Account)
	if !ok {
		that2, ok := that.(Account)
		if ok {
			that1 = &that2
		} else {
			return 1
		}
	}
	if that1 == nil {
		if this == nil {
			return 0
		}
		return 1
	} else if this == nil {
		return -1
	}
	if c := this.Address.Compare(that1.Address); c != 0 {
		return c
	}
	if this.Balance != that1.Balance {
		if this.Balance < that1.Balance {
			return -1
		}
		return 1
	}
	if this.Nonce != that1.Nonce {
		if this.Nonce < that1.Nonce {
			return -1
		}
		return 1
	}
	return 0
}
